import React from "react";
import {BrowserRouter as Router, Route} from "react-router-dom";

import Navbar from "./components/navbar"
import Timeline from "./components/timeline"
import Welcome from "./components/welcome"
import Projects from "./components/projects"

import "./public/styles/style.css";
import logo1 from './public/images/FarmtoFork.png';
import logo2 from './public/images/Logo.png';

function App() {
  return (
      <div className="app">
        <Navbar />
        <Welcome title="WELCOME" />
        <Timeline />
        <Welcome title="PROJECTS" />
        <Projects img={logo1} title="TrFood" text="Desarrollo de una plataforma web en relación con el proyecto DEMETER, junto al equipo de investigación de Ingeniería de Redes y Servicios Avanzados de Telecomunicación perteneciente al departamento de Sistemas Informáticos en la universidad Politécnica de Madrid."/>
      </div>
  );
}

export default App;
